"Мобильное приложение Новая Ижора: Личный кабинет – это удобный способ общения с управляющей компанией "Новая Ижора" через Ваш телефон!

Приложение позволяет собственнику квартиры в жилом доме получить доступ к личному кабинету жителя, предоставленному управляющей компанией "Новая Ижора".

Через приложение Вы сможете:

• подавать данные по приборам учета воды и электроэнергии;

• подавать заявки на ремонтные работы

• подавать обращения

• оплачивать квитанции за жилищно-коммунальные услуги;

• узнать полезные телефоны коммунальных и аварийных служб, обслуживающих Ваш дом;

• получать новости и уведомления от управляющей организации (например, о ремонтных работах, отключении воды).

Для предоставления доступа к личному кабинету, обратитесь в Вашу управляющую организацию. Информация о ней указана в счете-квитанции за жилищно-коммунальные услуги. Приложение работает в комплексе с программным продуктом для жилищно-коммунального рынка "1С:Учет в управляющих компаниях ЖКХ, ТСЖ и ЖСК". Функционал личного кабинета постоянно увеличивается и улучшается с введением новых сервисов!"
